LED LAMP is designed for mobile phone users to meet their flexible intelligent control LED Bluetooth devices and multi-function switching needs.

feature of product:
1. Quickly add and switch the required software services. Currently available software services include: LED BLE, LED DMX, LED SMART, LED STAGE, LED LIGHT, and new services will be launched in the future. Please look forward to;
2, flexible choice of lighting color, 16 million kinds of lighting colors to provide choice;
3, the light provides red, green and blue brightness adjustment, while supporting monochromatic light, supporting multi-point timing control;
4, the light provides 210 kinds of colorful mode selection, while supporting speed and brightness adjustment;
5, to provide custom mode color selection for lighting, rich in content and flexible, while supporting speed and brightness adjustment;
6, the light supports music and microphone mode, the light follows the rhythm of music and microphone changes;
7, support a variety of color sorting options, point settings, chip encoding settings, timing functions, skin replacement;
8, the phone shakes to change the color and mode of the light;
9, remote control is not limited by the direction of the distance can reach more than 15 meters;

1) Lights can recognize your usual color choices as you operate;
2) Lights can change color with beautiful music rhythm;
3) With timers switch, can be setting lights turn on off on time;
4) Selection of scenario modes with multiple colors;
5) A shake of the mobile phone can change the color of the light;
6) The color change of light can be controlled by sound;
7) The distance of remote control without direction limitation can reach more than 15 meters;
8) Lights can be changed from the photo on the mobile.

Make your device charging unique and incredible with Ampere app. Dive into incredibly cool, unique and colorful charging animations gallery for every taste, color and mood!

 Ampere App Content & Main Features: 
– Gallery of Animations – explore 27 categories of unique Charging Animations, such as: Neon, Technology, etc;
– Preview Animations – see how the selected Animation will look on your device charging before setting it; 
– Edit Animations – customize animations as you want by adding icons and charging sounds, changing colors. It contains 70+ Icons and 70+ Sounds; 
– 1000+ Charging Animations with daily updates;
– No ads!  

These animations are for personal automation using the “Shortcuts” app. Please note that animations will work with the Ampere app installed on your device.

How to Set Charging Animation?
1. Choose Animation you like, then tap “Set” button;
2. Open “Shortcuts” app;
3. Tap on “Automation” tab, then tap “Create Personal Automation”;
4. Scroll down and tap “Charger”;
5. Select “Is Connected”, then tap “Next”;
6. Tap on “Open App”;
7. Tap on “App”;
8. Search for “Ampere” app then choose it;
9. Tap “Next”;
10. Turn off “Ask Before Running”;
11. Tap “Don’t Ask”;
12. Tap “Done”;
13. Done! Just connect charger and enjoy your new Charging Animation.

Unclear? Do not worry! You can find a more detailed guide with pictures inside the app by clicking on the “Guide” button.

* Note that free version of the app is limited to 27 Charging Animations only (1 Charging Animation in each category for free). If you want to use the app without limits an auto-renewable subscription ”Ampere Premium (Pro)” is available.

 Auto-renewable Subscription ”Ampere Premium (Pro)” Info:
By subscribing you get premium (full, unlimited) access to all the features and content offered by Ampere app.

Auto-renewable Subscription “Ampere Premium (Pro)” Includes:
– Unlock All Charging Animations;
– Get Daily New Animations;
– Edit Animations;

The app contains the following auto-renewable subscription called ”Ampere Premium (Pro)”:
